import React from 'react'
import "../../public/static/css/footer.scss"

const Footer = () => {
    return (
        <div className="motherDivFooter">
            <p className="pokedexPFooter">Pokedex</p>
            <p className="namePFooter">Jacob Broughton</p>
        </div>
    )
}

export default Footer;
